import styled from "styled-components";
import { createGlobalStyle } from 'styled-components'
import Corbel from '../../Resources/corbel.ttf'

createGlobalStyle`
  @font-face {
    font-family: 'corbel';
    src: url('../../Resources/corbel.ttf');
  }
`
const Tema1_2 = styled.div`
    background: #26273D;
    min-height: 100%;
    min-height: 100vh;
    overflow: auto;    
`;

const Tema1_2_H1 = styled.h1`
    color: #A3A7B0;
    font-size: 30px;
    font-family: corbel;
    font-weight: 800;
`;

const Tema1_2_LoginCentralizar = styled.div`
    width: 400px;
    margin: auto;
    position: absolute
    top: 50%
    left: 50%
    margin-right: -50%
    transform: translate(-50%, -50%)
`;

console.log("TESTE");

export {Tema1_2, Tema1_2_H1, Tema1_2_LoginCentralizar} ;
